// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

contract MultiSig {

    address[] public owners;
    mapping(address => bool) public isOwner;
    uint public numConfirmationsRequired;

    struct Transaction {
        address to;
        uint value;
        bytes data;
        bool executed;
        mapping(address => bool) isConfirmed;
        uint numConfirmations;
    }

    Transaction[] public transactions;

    constructor(address[] memory _owners, uint _numConfirmationsRequired) public {
        require(_owners.length > 0, "owners required");
        require(
            _numConfirmationsRequired > 0 && _numConfirmationsRequired <= _owners.length,
            "invalid number of required confirmations"
        );

        for(uint8 i=0; i<_owners.length; i++) {
            address owner = _owners[i];

            require(owner != address(0), "invalid owner");
            require(!isOwner[owner], "owner not unique");

            isOwner[owner] == true;
            owners.push(owner);
        }

        numConfirmationsRequired = _numConfirmationsRequired;
    }

    modifier onlyOwner() {
        require(isOwner[msg.sender], "not owner");
        _;
    }

    modifier txExists(uint _txIndex) {
        require(_txIndex < transactions.length, "tx does not exist");
        _;
    }

    modifier notExecuted(uint _txIndex) {
        require(!transactions[_txIndex].executed, "tx already executed");
        _;
    }

    modifier notConfirmed(uint _txIndex) {
        require(!transactions[_txIndex].isConfirmed[msg.sender], "tx already confirmed");
        _;
    }

    function submitTransaction(
        address _to, 
        uint _value, 
        bytes memory _data
    ) public onlyOwner 
    {
        // uint txIndex = transactions.length;

        transactions.push(Transaction({
            to: _to,
            value: _value,
            data: _data,
            executed: false,
            numConfirmations: 0
        }));    
    }

    function confirmTransaction(uint _txIndex) 
    public 
    onlyOwner
    txExists(_txIndex)
    notExecuted(_txIndex) 
    notConfirmed(_txIndex)
    {
        Transaction storage transaction = transactions[_txIndex];

        transaction.isConfirmed[msg.sender] = true;
        transaction.numConfirmations += 1;   
    }

    function executeTransaction(uint _txIndex)
    public
    onlyOwner
    txExists(_txIndex)
    notConfirmed(_txIndex) 
    {
        Transaction storage transaction = transactions[_txIndex];

        require(
            transaction.numConfirmations >= numConfirmationsRequired,
            "cannot execute tx"
        );

        transaction.executed = true;

        (bool success, ) = transaction.to.call(transaction.data);
        require(success, "tx failed");
    }

    function revokeConfirmation(uint _txIndex)
    public
    onlyOwner
    txExists(_txIndex) 
    {
        Transaction storage transaction = transactions[_txIndex];
        
        require(
            transaction.isConfirmed[msg.sender],
            "not confirmed already"
        );

        transaction.isConfirmed[msg.sender] = false;
        transaction.numConfirmations -= 1;
    }

}

// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

contract MultiSig{
    uint8 constant public MAX_OWNER_COUNT = 50;

    mapping(address => bool) isOwner;
    address[]  owners;
    uint8  required;

    event ownerAdded(
        address owner
    );

    event ownerRemoved(
        address owner
    );

    event addedRequiredowner(
        address adder,
        uint numberOfowners
    );

    modifier ownerExists(address owner) {
        require(isOwner[owner],"owner not exist");
        _;
    }
    
    modifier ownerDoesNotExist(address owner) {
        require(!isOwner[owner],"owner already added");
        _;
    }
    
     modifier notNull(address _address) {
        require(_address != address(0));
        _;
    }

     modifier validRequirement(uint ownerCount, uint8 _required) {
        require(ownerCount <=MAX_OWNER_COUNT
            && _required <= ownerCount
            && ownerCount != 0,"Not sufficient owners");
        _;
    }

    modifier ZeroOwner(uint ownerCount){
        require(ownerCount!=0,"owner can not be zero");
        _;
    }

      modifier ZeroRequired(uint8 _required){
        require(_required!=0,"requirement can not be zero");
        _;
    }

    constructor() public{
        isOwner[msg.sender] = true;
        owners.push(msg.sender);
    }

    function setRequiredowner(
        uint8 _required
    ) public ownerExists(msg.sender) ZeroRequired(_required) validRequirement(owners.length, _required) {
        required = _required;

        emit addedRequiredowner(msg.sender, required);
    }

   
    function addowner(address owner)
    public
    ownerDoesNotExist(owner) 
    ownerExists(msg.sender)
    validRequirement(owners.length + 1, required)
    notNull(owner)
    {
    
        isOwner[owner] = true;
        owners.push(owner);
        emit ownerAdded(owner);
    }
    
    function removeowner(address owner) 
    public 
    ownerExists(msg.sender) 
    ownerExists(owner) 
    ZeroOwner(owners.length - 1)
    {
        
        isOwner[owner] = false;
        for (uint i=0; i<owners.length - 1; i++) {
            if (owners[i] == owner) {
                owners[i] = owners[owners.length - 1];
                break;
            }
        }
        owners.pop();
        
        if (required > owners.length) {
            required--;
        }

        emit ownerRemoved(owner);
    } 
    
    function checkOwner(address owner)public view returns(bool){
        return isOwner[owner];
    }
    
    function getRequired()public view returns(uint8){
        return required;
    }
    
    function getNumberOfOwner()public view returns(uint){
        return owners.length;
    }
    
    function getOwner(uint _index)public view returns(address){
        return owners[_index];
    }
}
